google.com/p/chrome-rest-client/issues/detail?id=50'>Issue 50<\/a> : Cannot remove file from body <\/li> <li> Fixed <a href='http://code.google.com/p/chrome-rest-client/issues/detail?id=51'>Issue 51<\/a> : XML Body has collapse/expand arrows, but they do not work <\/li> <li> Fixed <a href='http://code.google.com/p/chrome-rest-client/issues/detail?id=53'>Issue 53<\/a> : Cannot save Content-Type header <\/li> <\/ul> <p>2/7/2012<\/p> <ul> <li>Fixed history ammout<\/li> <li>Added option \"Clear history\"<\/li> <li>In \"Parsed response\" tab \"Open output in new window\" now paste HTML value into new window (instead of HTML markup text)<\/li> <\/ul> <p>1/24/2012<\/p> <ul> <li>Added Google App Engine server to store saved data and share it with coworkers<\/li> <\/ul> <p>1/11/2012<\/p> <ul> <li>Speed up code highlighting (I hope :).<\/li> <li>Added permission \"History\" to provide request url suggestions from browser history<\/li> <li>Fixed date-type header support (time now sets correctly)<\/li> <li>Reorganized database suggest oracle<\/li> <\/ul> <p>1/8/2012<\/p> <ul> <li>Improvements in CodeMirror load. Fixed non visible CodeMirror output.<\/li> <li>CodeMirror response panel now has clickable links (href and src attributes values).<\/li> <\/ul> <p>1/2/2012<\/p> <ul> <li>Added JSON headers definitions in options panel. Now user can define custom JSON headers.<\/li> <\/ul> <p>12/27/2011<\/p> <ul> <li>Fixed \"Authorization\" header support (restore basic params in wizard)<\/li> <li>Added shortcuts editor. Now you can define Your own shortcuts for some actions.<\/li> <li>Updated CodeMirror to version 2.2<\/li> <\/ul> <p>12/22/2011<\/p> <ul> <li>Fixed many headers with same name support<\/li> <li> Fixed long URL overflow in saved requests page ( <a href='http://code.google.com/p/chrome-rest-client/issues/detail?id=32'>Issue 32<\/a> ) <\/li> <li> Fixed BODY form array values ( <a href='http://code.google.com/p/chrome-rest-client/issues/detail?id=31'>Issue 31<\/a> ) <\/li> <\
